import React from 'react'
import Link from 'next/link'
import { AppLink } from './Icons/AppLink'


export const AppRouterLink = ({ href, children, ...rest }) => (
  <Link href={ href } { ...rest }>
    <AppLink>
      { children }
    </AppLink>
  </Link>
)
